import React from "react";
import { IoIosArrowDown, IoIosArrowUp } from "react-icons/io";

import { Container, GridItem, GridTitle } from "./styles";
import Image from "react-bootstrap/Image";

import pizzasDB from "./pizzasDB";

export default function GridPizzas() {
  return (
    <Container id="containerElement">
      {pizzasDB.map((pizza) => (
        <>
          <GridTitle name="amp">AS MAIS PEDIDAS</GridTitle>
          <div>
            <GridItem>
              <Image src={pizza.image} />
              <div>
                <span>{pizza.title}</span>
                <IoIosArrowUp size={30} onClick={() => alert("teste")} />
              </div>
            </GridItem>
          </div>
        </>
      ))}
    </Container>
  );
}
